	add("timonism", "{\"term\":\"timonism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Timon|ism|lang\u003den}}, from the 5th-century BC person {{w|Timon of Athens (person)|Timon of Athens}} (as described by Plutarch, Lucian, Aristophanes), possibly by way of {{w|William Shakespeare}}\u0027s play \u0027{{w|Timon of Athens}}\u0027 (c. 1607). Used in the \u0027{{w|Westminster Review}}\u0027 (maybe after the earlier \u0026quot;Timonist\u0026quot;) in an 1840 review. (Coining erroneously attributed to {{w|Herman Melville}}, who popularized it later in 1852.)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of bitter misanthropy, a despair leading to hatred or contemptuous rejection of mankind, like\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"This most cruel betrayal led him to \u0027\u0027Timonism\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A bitter or cynical utterance or behavior, in the manner of\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Pay no attention to his \u0027\u0027Timonisms\u0027\u0027, it\u0027s a pose\", \"priority\":4}]}, \"synonyms\":{}}");

